    palette:{

      primary:{

        main:"#ED5E93"

      },
      secondary:{
        main:"#FFF3FA"
      },
      info:{
        main:"#28161C"
      }

    },
    overrides:{
   muiButton:{
     borderRadius:'0',
     cursor:'pointer'
   }
    }



    })



  return (
    <>
     <ThemeProvider theme={customtheme} >
    <Home />
    </ThemeProvider>
    </>
  )

}
export default App;
